    "modules-left": [                     // модули слева
        "hyprland/workspaces"
        // "wlr/taskbar"



    ],
    "modules-center": [           // модули по центру 
      "clock"




    ],
    "modules-right": [ // модули справа   .





        "hyprland/language",
