 *                                                                                      *
 ****************************************************************************************/


 "tray": {

  "icon-size": 22, // Размер иконок в трее
  // Расстояние между иконками в трее
  // "icons": {   // задать свои темы иконок
	//     "blueman": "bluetooth",
	//     "TelegramDesktop": "$HOME/.local/share/icons/hicolor/16x16/apps/telegram.png"
	// },
  "spacing": 8
},


/****************************************************************************************
