 *                                                                                      *
 ****************************************************************************************/

 #language {
  border-radius: 1rem 0rem 0rem 1rem;              /* Скругление углов */
  margin: 0.5rem 0rem;
  padding: 0.3rem 0rem 0rem 1.5rem;              /* Внутренние отступы */

}



/****************************************************************************************
 *                                                                                      *
