 *                                                                                      *
 ****************************************************************************************/

#custom-swaync {
	color: #00ffcc;  /* Цвет текста иконки SwayNC */
  border-radius: 0rem 1rem 1rem 0rem;              /* Скругление углов */
  margin: 0.5rem 1rem 0.5rem 0rem;
  padding: 0rem 2rem 0rem 1rem;              /* Внутренние отступы */
}

#custom-swaync.notification {
  background-color: #e20b20;  /* Цвет фона иконки SwayNC при наличии уведомлений */
  color: #ffffff;  /* Цвет текста при наличии уведомлений */
  animation: blink 1s infinite;  /* Анимация для мигания */
  border-radius: 0rem 1rem 1rem 0rem;              /* Скругление углов */
  margin: 0.5rem 1rem 0.5rem 0rem;
  padding: 0rem 2rem 0rem 1rem;              /* Внутренние отступы */
}

@keyframes blink {
  0% { opacity: 1; }  /* Начало анимации, полная видимость */
  50% { opacity: 0.3; }  /* Середина анимации, уменьшенная видимость */
  100% { opacity: 1; }  /* Конец анимации, полная видимость */
}



