#!/bin/bash

case $1 in
	--COL)
		if ! `nmcli d | grep "wifi" | grep -q "connected"`; then
			echo "#3e424f"
		else
			echo "#a1bdce"
		fi
		;;
	--ESSID)
		if ! `nmcli d | grep "wifi" | grep -q "connected"`; then
			echo "Not Connected"
		else
			nmcli d | grep "wifi" | awk '{print $4}'
		fi
		;;
	--ICON)
		if ! `nmcli d | grep "wifi" | grep -q "connected"`; then
			echo "睊"
		else
			echo "直"
		fi
		;;
esac

