#!/bin/bash

bspc subscribe desktop node_transfer | while read -r _; do
    ~/./.config/eww/bar/scripts/workspace.sh
done

spaces() {
    spaces=""
    for i in $(bspc query -D --names); do
        spaces+=" (eventbox :onclick \"bspc desktop -f $i\" \"${i}\")"
    done
    echo "$spaces"
}

bspc query -D -d .active --names
echo "(box :class \"works\" :orientation \"h\" :space-evenly \"false\" :halign \"start\" $(spaces))"


