--- Пример/bar-old/scripts/music_info ---

#!/bin/bash

# See README.md for usage instructions
cache_dir="$HOME/.cache/eww"
music_dir="$HOME/Music"

#path to current song
song_path_file="$cache_dir/song_path"
song_path=""
[ -f "$song_path_file" ] && song_path="$(cat "$song_path_file")"

#cache for cover art
cover_path_file="$cache_dir/cover_path"
cover_path=""
[ -f "$cover_path_file" ] && cover_path="$(cat "$cover_path_file")"

#fallback image
fallback_image_path="$HOME/.config/eww/bar/images/fallback.png"

# get status
status() {
	playerctl status 2> /dev/null
}

# get song title
song() {
	playerctl metadata title 2> /dev/null
}

# get song artist
artist() {
	playerctl metadata artist 2> /dev/null
}

# get song album
album() {
	playerctl metadata album 2> /dev/null
}

# get cover art
cover() {
	#get the url of the cover art
	art_url="$(playerctl metadata mpris:artUrl 2> /dev/null)"

	#if the cover art url is a file, then just print the path
	#if not, then download it and print the path
	if [[ "$art_url" == "file://"* ]]; then
		art_path="${art_url/file:\/\//}"
		echo "$art_path"
	elif [[ "$art_url" == "http://"* || "$art_url" == "https://"* ]]; then
		# extension of the file
		art_ext="${art_url##*.}"
		[ "$art_ext" != "png" ] && [ "$art_ext" != "jpg" ] && art_ext="jpg"

		# downloaded file path
		art_path="$cache_dir/cover.$art_ext"

		# download the cover art
		curl -s "$art_url" -o "$art_path"
		echo "$art_path"
	else
		# if there is no cover art, then print the fallback image
		echo "$fallback_image_path"
	fi
}

# get current song path
current_song_path() {
	echo "$(playerctl metadata xesam:url 2> /dev/null)"
}

# get song time
time() {
	# get the current and total time in micro seconds
	position="$(playerctl metadata mpris:length 2> /dev/null)"
	[ -z "$position" ] && position=0
	current_pos="$(playerctl position 2> /dev/null)"
	[ -z "$current_pos" ] && current_pos=0

	# get the total time in seconds
	total_time="$((position / 1000000))"
	# get the current time in seconds
	current_time="$((current_pos))"

	# print the progress in percentage
	echo "$((current_time * 100 / total_time))"
}

# get song status
p_status() {
	# get the status of the song
	s="$(status)"

	# if the song is playing, then print the pause icon
	# if not, then print the play icon
	if [ "$s" == "Playing" ]; then
		echo ""
	else
		echo ""
	fi
}

# toggle play/pause
toggle() {
	playerctl play-pause 2> /dev/null
}

# next song
next() {
	playerctl next 2> /dev/null
}

# previous song
prev() {
	playerctl previous 2> /dev/null
}

# print the info
case "$1" in
	"--song") song ;;
	"--artist") artist ;;
	"--album") album ;;
	"--cover")
		# if the song has changed, then get the new cover art
		# if not, then print the cached cover art
		new_song_path="$(current_song_path)"
		if [ "$song_path" != "$new_song_path" ]; then
			song_path="$new_song_path"
			echo "$song_path" > "$song_path_file"
			cover_path="$(cover)"
			echo "$cover_path" > "$cover_path_file"
		fi
		echo "$cover_path"
		;;
	"--time") time ;;
	"--status") p_status ;;
	"--toggle") toggle ;;
	"--next") next ;;
	"--prev") prev ;;
esac

